import React from 'react';
import { Header } from 'semantic-ui-react';

function ShaneTitle() {
    return(
        <div>
            <Header color="grey" textAlign="center">
                <Header.Content>
                    Sidney Vinson Photography
                </Header.Content>
            </Header>
        </div>
    )
}

export default ShaneTitle;
